when matched then
update set
[ID]=s.[ID] ,[Name]=s.[Name] ,[BusinessEntityDefinitionID]=s.[BusinessEntityDefinitionID] ,[Settings]=s.[Settings] ,[CreatedBy]=s.[CreatedBy] ,[CreatedTime]=s.[CreatedTime] ,[LastModifiedBy]=s.[LastModifiedBy] ,[LastModifiedTime]=s.[LastModifiedTime] 
when not matched by target then
insert([ID],[Name],[BusinessEntityDefinitionID],[Settings],[CreatedBy],[CreatedTime],[LastModifiedBy],[LastModifiedTime])
values(s.[ID], s.[Name], s.[BusinessEntityDefinitionID], s.[Settings], s.[CreatedBy], s.[CreatedTime], s.[LastModifiedBy], s.[LastModifiedTime]);
                  
